// import logo from './logo.svg';
import './App.css';
import React ,{ useEffect, useState } from 'react';

import Food from './food';
import Header from './header'

function App() {

  const [food,setFood] = useState([]);

  useEffect(()=>{
    getItem();
  },[])

  const getItem = async () =>{
    const response = await fetch(
      "http://localhost:9002/food"
    );
    const data = await response.json();
    console.log(data);
    setFood(data);
  }


  return (
    <div className="App">
      <Header/>
      {food.map(food =>(
        <Food url={food.img_url} title={food.Fname} desc={food.descr} price={food.Fprice}/>
      ))}
    </div>
  );
}

export default App;
